import React from 'react';

const FilterResult = ({ products }) => (
  <div>
    <h2>Filtered Products:</h2>
    <ul>
      {products.map((product) => (
        <li key={product.id}>{product.name}</li>
      ))}
    </ul>
  </div>
);

export default FilterResult;
